const ItemList = ({detalles }) => { 

  
    return (

        <>
               {detalles.map((detalle, i)=>{
            return <Link  to={`https://fakestoreapi.com/products/${detalles.id}`}><Item key={detalle.id} name={detalle.title} price={detalle.price} stock={detalle.stock}  /></Link>

        })

        }
        

        
</>

)}

export default ItemList
